For an elliptic curve \(E: y^2 = x^3 + ax + b\), the addition of points \(P\) and \(Q\) to get \(R = P + Q\) is defined as follows: If \(P = \mathcal{O}\), \(R = Q\). If \(Q = \mathcal{O}\), \(R = P\). Otherwise, let \(P = (x_P, y_P), Q = (x_Q, y_Q)\). Then: If \(y_P = -y_Q\), \(R = \mathcal{O}\) If \(y_P \neq -y_Q\), \(R = (x_R = \lambda^2 - x_P - x_Q, y_R = \lambda(x_P - x_R) - y_P)\), where \(\lambda = \) \( \begin{cases} \frac{y_P - y_Q}{x_P - x_Q} \quad &\hbox{If } (x_P \neq x_Q) \\ \frac{3^{2}_{P} + a}{2y_P} \quad &\hbox{Otherwise} \end{cases}\) Example: On \(E: y^2 = x^3 + 2x + 3\) over \(\mathbb{F}_{7}\), let \(P = (5, 1)\) and \(Q = (4, 4)\). Then, \(P + Q = (0, 5)\), where \(\lambda = \frac{1 - 4}{5 - 4} \equiv 4 \bmod 7\). impl<F: Field> EllipticCurvePoint<F> { fn new(x: F, y: F, curve: EllipticCurve<F>) -> Self { EllipticCurvePoint { x: Some(x), y: Some(y), curve: curve, } } pub fn point_at_infinity(curve: EllipticCurve<F>) -> Self { EllipticCurvePoint { x: None, y: None, curve: curve, } } pub fn is_point_at_infinity(&self) -> bool { self.x.is_none() || self.y.is_none() } pub fn line_slope(&self, other: Self) -> F { let x1 = self.x.clone().unwrap(); let y1 = self.y.clone().unwrap(); let x2 = other.x.clone().unwrap(); let y2 = other.y.clone().unwrap(); if self.x.clone() == other.x.clone() { ((x1.clone() * x1.clone()) * (3_i64) + self.curve.a.clone()) / (y1.clone() * (2_i64)) } else { (y2.clone() - y1.clone()) / (x2.clone() - x1.clone()) } }
} impl<F: Field> Add for EllipticCurvePoint<F> { type Output = Self; fn add(self, other: Self) -> Self { if self.is_point_at_infinity() { return other; } if other.is_point_at_infinity() { return self; } let m = self.line_slope(other.clone()); if self.x == other.x { if self.y != other.y { return EllipticCurvePoint::point_at_infinity(self.curve.clone()); } else { let x1 = self.x.clone().unwrap(); let y1 = self.y.clone().unwrap(); let x3 = m.clone() * m.clone() - x1.clone() - x1.clone(); let y3 = m * (x1 - x3.clone()) - y1; return EllipticCurvePoint::new(x3, y3, self.curve.clone()); } } else { let x1 = self.x.clone().unwrap(); let y1 = self.y.clone().unwrap(); let x2 = other.x.clone().unwrap(); let x3 = m.clone() * m.clone() - x1.clone() - x2.clone(); let y3 = m * (x1 - x3.clone()) - y1; return EllipticCurvePoint::new(x3, y3, self.curve.clone()); } }
}

