Let \(m \geq 1\) and write its binary expansion as: \begin{equation} m = m_0 + m_1 \cdot 2 + m_2 \cdot 2^2 + \cdots + m_{n-1} \cdot 2^{n-1} \end{equation} where \(m_i \in \{0, 1\}\) and \(m_{n-1} \neq 0\). The following algorithm, using the function \(g_{P,Q}\) defined in the previous theorem, returns a function \(f_P\) whose divisor satisfies: \begin{equation} div(f_P) = m[P] - m[P] - (m - 1)[\mathcal{O}] \end{equation} =========================== Miller's Algorithm Set \(T = P\) and \(f = 1\) For \(i \gets n-2 \cdots 0\) do Set \(f = f^2 \cdot g_{T, T}\) Set \(T = 2T\) If \(m_i = 1\) then Set \(f = f \cdot g_{T, P}\) Set \(T = T + P\) End if End for Return \(f\) =========================== Proof: TBD pub fn get_lambda<F: Field>( p: EllipticCurvePoint<F>, q: EllipticCurvePoint<F>, r: EllipticCurvePoint<F>,
) -> F { let p_x = p.x.clone().unwrap(); let p_y = p.y.clone().unwrap(); let q_x = q.x.clone().unwrap(); // let q_y = q.y.clone().unwrap(); let r_x = r.x.clone().unwrap(); let r_y = r.y.clone().unwrap(); if (p == q && p_y.clone() == F::zero()) || (p != q && p_x.clone() == q_x.clone()) { return r_x.clone() - p_x.clone(); } let slope = p.line_slope(q.clone()); let numerator = r_y.clone() - p_y.clone() - slope.clone() * (r_x.clone() - p_x.clone()); let denominator = r_x.clone() + p_x.clone() + q_x.clone() - slope.clone() * slope.clone(); return numerator / denominator;
} pub fn miller<F: Field>(p: EllipticCurvePoint<F>, q: EllipticCurvePoint<F>, m: BigInt) -> F { if p == q { F::one(); } let mut f = F::one(); let mut t = p.clone(); for i in (1..m.bits()).rev() { f = (f.clone() * f.clone()) * (get_lambda(t.clone(), t.clone(), q.clone())); t = t.clone() + t.clone(); if m.bit(i) { f = f * (get_lambda(t.clone(), p.clone(), q.clone())); t = t.clone() + p.clone(); } } f
} pub fn weil_pairing<F: Field>( p: EllipticCurvePoint<F>, q: EllipticCurvePoint<F>, m: BigInt, s: Option<EllipticCurvePoint<F>>,
) -> F { let s_value = s.unwrap(); let fp_qs = miller(p.clone(), q.clone() + s_value.clone(), m.clone()); let fp_s = miller(p.clone(), s_value.clone(), m.clone()); let fq_ps = miller(q.clone(), p.clone() - s_value.clone(), m.clone()); let fq_s = miller(q.clone(), -s_value.clone(), m.clone()); return (fp_qs / fp_s) / (fq_ps / fq_s);
}
